import React from "react";
import "./assests/style.css";
import JSONDATA from "./Services.json";
import Footer from "./Footer";

export default function SearchServices() {
  
  return (
    <>
      <section>
        <div className="container-fluid bg-light hght">
          <div className="container">
            <h1
              style={{
                color: "#3d403e",
                marginTop: "2px",
                marginBottom: "32px",
              }}
            >
              All Services
            </h1>
            <form class="d-flex  " role="search">
              <input
                className="form-control me-3 mb-4  service-input input-width"
                type="search"
                placeholder="Search"
                aria-label="Search"
                
              />
              <button className="btn btn-warning p-2 mb-4 btnn " type="submit">
                SEARCH
              </button>
            </form>

            <div className="row">
              <div className="col-md-4">
                <b>CONSULT AN EXPERT</b>
                {JSONDATA.map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="" className="itemstyle">
                        {val.consult}
                      </a>
                    </li>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>Tax</b>

                {JSONDATA.map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="">{val.tax}</a>
                    </li>
                  );
                })}
              </div>

              <div className="col-md-4">
                <b>DOCUMENTATION</b>
                {JSONDATA.map((val, key) => {
                  return (
                    <li key={key}>
                      <a href="">{val.documentation}</a>
                    </li>
                  );
                })}
              </div>
            </div>
          </div>
        </div>
      </section>
      <Footer/>
    </>
  );
}
